const chargeitemStatus = {"resourceType":"CodeSystem","id":"chargeitem-status","meta":{"lastUpdated":"2022-05-28T13:47:40.239+11:00","profile":["http://hl7.org/fhir/StructureDefinition/shareablecodesystem"]},"text":{"status":"generated","div":"<div xmlns=\"http://www.w3.org/1999/xhtml\">\n      \n      <h2>ChargeItemStatus</h2>\n      \n      <div>\n        \n        <p>Codes identifying the lifecycle stage of a ChargeItem.</p>\n\n      \n      </div>\n      \n      <p>This code system http://hl7.org/fhir/chargeitem-status defines the following codes:</p>\n      \n      <table class=\"codes\">\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">\n            \n            <b>Code</b>\n          \n          </td>\n          \n          <td>\n            \n            <b>Display</b>\n          \n          </td>\n          \n          <td>\n            \n            <b>Definition</b>\n          \n          </td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">planned\n            \n            <a name=\"chargeitem-status-planned\"> </a>\n          \n          </td>\n          \n          <td>Planned</td>\n          \n          <td>The charge item has been entered, but the charged service is not  yet complete, so it shall not be billed yet but might be used in the context of pre-authorization.</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">billable\n            \n            <a name=\"chargeitem-status-billable\"> </a>\n          \n          </td>\n          \n          <td>Billable</td>\n          \n          <td>The charge item is ready for billing.</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">not-billable\n            \n            <a name=\"chargeitem-status-not-billable\"> </a>\n          \n          </td>\n          \n          <td>Not billable</td>\n          \n          <td>The charge item has been determined to be not billable (e.g. due to rules associated with the billing code).</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">aborted\n            \n            <a name=\"chargeitem-status-aborted\"> </a>\n          \n          </td>\n          \n          <td>Aborted</td>\n          \n          <td>The processing of the charge was aborted.</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">billed\n            \n            <a name=\"chargeitem-status-billed\"> </a>\n          \n          </td>\n          \n          <td>Billed</td>\n          \n          <td>The charge item has been billed (e.g. a billing engine has generated financial transactions by applying the associated ruled for the charge item to the context of the Encounter, and placed them into Claims/Invoices.</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">entered-in-error\n            \n            <a name=\"chargeitem-status-entered-in-error\"> </a>\n          \n          </td>\n          \n          <td>Entered in Error</td>\n          \n          <td>The charge item has been entered in error and should not be processed for billing.</td>\n        \n        </tr>\n        \n        <tr>\n          \n          <td style=\"white-space:nowrap\">unknown\n            \n            <a name=\"chargeitem-status-unknown\"> </a>\n          \n          </td>\n          \n          <td>Unknown</td>\n          \n          <td>The authoring system does not know which of the status values currently applies for this charge item  Note: This concept is not to be used for &quot;other&quot; - one of the listed statuses is presumed to apply, it's just not known which one.</td>\n        \n        </tr>\n      \n      </table>\n    \n    </div>"},"extension":[{"url":"http://hl7.org/fhir/StructureDefinition/structuredefinition-wg","valueCode":"pa"},{"url":"http://hl7.org/fhir/StructureDefinition/structuredefinition-standards-status","valueCode":"trial-use"},{"url":"http://hl7.org/fhir/StructureDefinition/structuredefinition-fmm","valueInteger":0}],"url":"http://hl7.org/fhir/chargeitem-status","identifier":[{"system":"urn:ietf:rfc:3986","value":"urn:oid:2.16.840.1.113883.4.642.4.847"}],"version":"4.3.0","name":"ChargeItemStatus","title":"ChargeItemStatus","status":"draft","experimental":false,"date":"2021-01-17T07:06:13+11:00","publisher":"HL7 (FHIR Project)","contact":[{"telecom":[{"system":"url","value":"http://hl7.org/fhir"},{"system":"email","value":"fhir@lists.hl7.org"}]}],"description":"Codes identifying the lifecycle stage of a ChargeItem.","caseSensitive":true,"valueSet":"http://hl7.org/fhir/ValueSet/chargeitem-status","content":"complete","concept":[{"code":"planned","display":"Planned","definition":"The charge item has been entered, but the charged service is not  yet complete, so it shall not be billed yet but might be used in the context of pre-authorization."},{"code":"billable","display":"Billable","definition":"The charge item is ready for billing."},{"code":"not-billable","display":"Not billable","definition":"The charge item has been determined to be not billable (e.g. due to rules associated with the billing code)."},{"code":"aborted","display":"Aborted","definition":"The processing of the charge was aborted."},{"code":"billed","display":"Billed","definition":"The charge item has been billed (e.g. a billing engine has generated financial transactions by applying the associated ruled for the charge item to the context of the Encounter, and placed them into Claims/Invoices."},{"code":"entered-in-error","display":"Entered in Error","definition":"The charge item has been entered in error and should not be processed for billing."},{"code":"unknown","display":"Unknown","definition":"The authoring system does not know which of the status values 